function CurrentBuildCard({ el }) {
  console.log(el);
  return (
    <div className='card'>
      <h3> </h3>
      {el.photos.map((el) =>
        el.backgroundimage.map((el) => <img className='buildcardIMG' src={el.path} alt='background' />)
      )}
      <main>
        <div className='container'>
          <div className='gallery'>
            {/*begin of image map here */}
            <div className='gallery-item' tabIndex={0}>
              <img
                src='https://images.unsplash.com/photo-1515814472071-4d632dbc5d4a?w=500&h=500&fit=crop'
                className='gallery-image'
                alt=''
              />
              <div className='gallery-item-info'>
                <ul>
                  <li>{el.buildname}</li>
                  <li className='gallery-item-likes'>
                    <span className='visually-hidden'>Likes:</span>
                    <i className='fas fa-heart' aria-hidden='true' /> 66
                  </li>
                  <li className='gallery-item-comments'>
                    <span className='visually-hidden'>Comments:</span>
                    <i className='fas fa-comment' aria-hidden='true' /> 2
                  </li>
                </ul>
              </div>
              {/*end of image */}
            </div>
          </div>
          {/* End of gallery */}
        </div>
        {/* End of container */}
      </main>
    </div>
  );
}

export default CurrentBuildCard;
